import React from 'react'


const Persons = ({persons,deletePerson}) => {
  const personList = Object.entries(persons)
  return (
    <div>
      {personList.map(([name , number]) =>
        <div key={name}>
          {name} {number} {deletePerson}
        </div>
      )}
    </div>
  )
}

export default Persons
